import axios from "axios";

interface User {
	id: number,
	email: string,
	firstName?: string,
	lastName?: string,
	userName?: string,
}

function GetAllUsers(): User[] {

	const users: Array<User> = [];

	axios.get('http://localhost:3001/user')
	.then(response => {
		response.data.forEach((element: User) => {
			users.push(element);
		});
	});
	return users;
}

const App:React.FC = () =>
{
	const users: User[] = GetAllUsers();
	console.log(users);

	return (
		<div> 
			<h1>These are all the Users!</h1>
			<ul>
				<li>test</li>
				{users.forEach(element => {
					element.email
				})}
				<li>{users[0] ? users[0].email : "hello"}</li>
			</ul>
		</div>
		);
}

export default App;
